 I meet the same problem and don't know how to solve it.

 here's how I solved it:

 // React 17 // import React from "react"; // import ReactDOM from
 "react-dom"; // import App from "./App";

 // ReactDOM.render(, document.getElementById("root"));

 // React 18: import React from "react"; import ReactDOM from
 "react-dom/client"; import App from "./App";

 ReactDOM.createRoot(document.getElementById("root")).render();

 So basically it updates from React 17 to 18 and uses the new API. I just
 kept the old one there commented out for reference.

 Basically there's just those two lines that changes:

 import ReactDOM from "react-dom/client";
 ReactDOM.createRoot(document.getElementById("root")).render(<App />);

 this solution fixed the react 18 error but still I can not console log the
 data from API

